import React from 'react';
import { Link } from 'react-router-dom';
import personal1 from '../images/project-snapshots/Personal-1.png';

const ProjectPreview = ({ portfolioProject }) => (
   <>
      {portfolioProject.map((project, key) => (
         <Link key={key} to={`/portfolio/${project.name}`}>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <button>Learn more</button>
         </Link>
      ))}
   </>
);

export default ProjectPreview;
